package com.pm.rap.toe.model;

public abstract class BaseElement {

	private double u;
	private double i;
	private double r;
	
	public BaseElement() {
		// TODO Auto-generated constructor stub
	}

	public double getU() {
		return u;
	}

	public void setU(double u) {
		this.u = u;
	}

	public double getI() {
		return i;
	}

	public void setI(double i) {
		this.i = i;
	}

	public double getR() {
		return r;
	}

	public void setR(double r) {
		this.r = r;
	}

}
